import { SET_DATA, REMOVE_DATA} from "../Actions/Types";
const initialState = {
modelData:null
}
export default function(state=initialState,action){
    const type = action.type;

    switch(type){

        case SET_DATA:
            return {...state,modelData: action.payload}
        case REMOVE_MODEL_DATA:
            return {...state, modelData:null}
        default:
            return {...state}


    }
}
